import React, { Component } from 'react';

class ProductTable extends Component {
  render() {
    return (
      <table>
        <thead>
          <tr>
            <th>Isim</th>
            <th>Odooid</th>
            <th>Musteri</th>
            <th>Teknik Cizim (PDF)</th>
            <th>Kilavuz (PDF, JPG)</th>
            <th>Islemler</th>
          </tr>
        </thead>
        <tbody>
          {this.props.products.map(product => (
            <tr key={product.odooid}>
              <td>{product.isim}</td>
              <td>{product.odooid}</td>
              <td>{product.musteri}</td>
              <td>{product.teknik_cizim}</td>
              <td>{product.kilavuz}</td>
              <td>Kaydet Sil</td>
            </tr>
          ))}
        </tbody>
      </table>
    );
  }
}

export default ProductTable;
